INSERT INTO `berita` (`id_berita`, `nama_berita`, `ket_berita`, `gambar_berita`, `prioritas`) VALUES
(1, 'indra', '                                                                    Sebuah sistem autentikasi identitas manusia, hewan, tumbuhan, benda, dan lain-lain yang memiliki akurasi tinggi sangat diperlukan saat ini karena meningkatnya perkembangan Deep Machine Learning di Dunia. Secara luas sistem saat ini menggunakan sistem biometrik seperti kontrol akses, identifikasi kriminal, autonomous vending, dan automated banking karena keunikan fitur biometrik dan karakteristik yang tidak dapat dipindah tangankan (non-transferable  characteristic)[1]. \r\n\r\n\r\n<p>Biometrik dibagi menjadi dua kategori yaitu berdasarkan perilaku seseorang seperti ritme mengetik, gaya berjalan atau suara dan berdasarkan fisiologis seperti sidik jari, wajah, iris, atau tanda tangan. Bagaimana menduplikasi kemampuan manusia dalam memahami informasi citra, agar komputer dapat mengenali objek pada citra selayaknya manusia. Proses feature engineering yang digunakan pada ummumnya sangat terbatas dimana hanya dapat berlaku pada dataset tertentu saja tanpa kemampuan generalisasi pada jenis citra apapun. Hal tersebut dikarenakan berbagai perbedaan antar citra antara lain perbedaan sudut pandang, perbedaan skala, perbedaan kondisi pencahayaan, deformasi objek, dan sebagainya.                                                             </p>    ', 'file_1511879853.png', 0),
(13, 'dee', 'ookok', 'file_1511786119.jpg', 1),
(11, 'asdasd', 'nmnmnasdkasdlkak akdlaskdalskd alaksdlaskdalsdk klaskdlaksd lkas daklsdkalskd askldalskdalskd askdlaskdlaskdlakd', 'file_1511801903.jpg', 2),
(12, 'lllkk', 'mnmbn ajsdajsdh eiruiutiwoer  aidfoid sfgiueortoa eurtia uetioeur tiuerit sieorut siourt isoert ', 'file_1511802010.PNG', 2),
(14, 'wdwin', '<p style="text-align:justify">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Sebuah sistem autentikasi identitas manusia, hewan, tumbuhan, benda, dan lain-lain yang memiliki akurasi tinggi sangat diperlukan saat ini karena meningkatnya perkembangan Deep Machine Learning di Dunia. Secara luas sistem saat ini menggunakan sistem biometrik seperti kontrol akses, identifikasi kriminal, autonomous vending, dan automated banking karena keunikan fitur biometrik dan karakteristik yang tidak dapat dipindah tangankan (non-transferable characteristic)[1].</p>\r\n\r\n<p style="text-align:justify">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Biometrik dibagi menjadi dua kategori yaitu berdasarkan perilaku seseorang seperti ritme mengetik, gaya berjalan atau suara dan berdasarkan fisiologis seperti sidik jari, wajah, iris, atau tanda tangan. Bagaimana menduplikasi kemampuan manusia dalam memahami informasi citra, agar komputer dapat mengenali objek pada citra selayaknya manusia. Proses feature engineering yang digunakan pada ummumnya sangat terbatas dimana hanya dapat berlaku pada dataset tertentu saja tanpa kemampuan generalisasi pada jenis citra apapun. Hal tersebut dikarenakan berbagai perbedaan antar citra antara lain perbedaan sudut pandang, perbedaan skala, perbedaan kondisi pencahayaan, deformasi objek, dan sebagainya.</p>\r\n', 'file_1511932274.jpg', 1);
