(11, 'haloo', '<p style="text-align:center">Biometrik dibagi menjadi dua kategori yaitu berdasarkan perilaku seseorang seperti ritme mengetik, gaya berjalan atau suara dan berdasarkan fisiologis seperti sidik jari, wajah, iris, atau tanda tangan. Bagaimana menduplikasi kemampuan manusia dalam memahami informasi citra, agar komputer dapat mengenali objek pada citra selayaknya manusia. Proses feature engineering yang digunakan pada ummumnya sangat terbatas dimana hanya dapat berlaku pada dataset tertentu saja tanpa kemampuan generalisasi pada jenis citra apapun. Hal tersebut dikarenakan berbagai perbedaan antar citra antara lain perbedaan sudut pandang, perbedaan skala, perbedaan kondisi pencahayaan, deformasi objek, dan sebagainya.</p>\r\n', 'file_1511932865.jpg');
